import "./App.css";
import { useEffect } from "react";
import axios from "axios";

function App() {
  useEffect(() => {
    const getAPI = async () => {
      try {
        return await axios.get(
          "http://openapi.data.go.kr/openapi/service/rest/Covid19/getCovid19SidoInfStateJson?serviceKey=et%2BHzIp9xULbk7BU%2F07ziyDd9rkLsS6ZqNDwPfF7v7a7XjnjWuyUqp9QZvicWD%2Fo1KZr3YmtyXkQAtnpqgqX9Q%3D%3D&pageNo=1&numOfRows=10&startCreateDt=20200410&endCreateDt=20200410"
        );
      } catch {
        (error) => console.log(error);
      }
    };
    getAPI();
  }, []);
  return <div></div>;
}

export default App;
